import React from "react";
import Button2 from "../../../common/atoms/Button2";
import Header1 from "../../../common/blocks/Header1";
import { BiSearch } from "react-icons/bi";
import { useNavigation } from "../../../hooks/useNavigation";

const MemberProfile = () => {
  const { navigateToBack } = useNavigation();
  const buttonsHeader = [
    {
      component: Button2,
      className: "font-TAEBAEKmilkyway",
      value: "뒤로가기",
      onClick: navigateToBack,
      icon: <BiSearch />,
    },
    <button
                  className="font-TAEBAEKmilkyway inline-flex items-center rounded-full border border-transparent bg-purple-700 p-2 text-white shadow-lg hover:bg-purple-800 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:ring-offset-2"
                  onClick={button.onClick}
                >
                  {/* 버튼 옆에 "프로필 페이지" 텍스트를 추가 */}
                  {button.value === "뒤로가기" && (
                    <span className="ml-2">프로필 페이지</span>
                  )}
                </button>
  ];

  return (
    <div>
      <Header1 buttons={buttonsHeader} />
      <h1>프로필 화면입니다.</h1>
    </div>
  );
};

export default MemberProfile;
